import React from 'react';
import '../styles/main.css';

import Header from './Header';
import Banner from './Banner';
import About from './About';
import Products from './Products';
import Footer from './Footer';

import Slideshow from './AutoSwipe/SlideShow';
import slide1 from "../assets/bgBanner1.jpg";
import slide2 from "../assets/bgBanner2.jpg";
import slide3 from "../assets/bgBanner3.jpg";
import slide4 from "../assets/bgBanner4.jpg";
import slide5 from "../assets/bgBanner5.jpg";

const slides = [slide1, slide2, slide3, slide4, slide5];

const App = () => (
  <div className="App">
    <Slideshow slides={slides} />
  </div>
);

export default App;
